INSERT INTO public.books (id,open_library_id,title,description,authors,page_count,cover_image_url,cover_image_width,cover_image_height,created_at) VALUES (41, 'OL7950145M', 'Dangerous Visions', NULL, '{"Harlan Ellison"}', 592, 'https://covers.openlibrary.org/b/id/477258-M.jpg', 180, 268, DEFAULT), (42, 'OL9655772M', 'Childhood''s End', 'Childhood''s End is a 1953 science fiction novel by British author Arthur C. Clarke. The story follows the peaceful alien invasion of Earth by the mysterious Overlords, whose arrival ends all war, helps form a world government, and turns the planet into a near-utopia. Many questions are asked about the origins and mission of the aliens, but they avoid answering, preferring to remain in their ships, governing through indirect rule. Decades later, the Overlords eventually show themselves, and their impact on human culture leads to a Golden Age. However, the last generation of children on Earth begin to display powerful psychic abilities, heralding their evolution into a group mind, a transcendent form of life. ', '{"Arthur C. Clarke"}', 224, 'https://covers.openlibrary.org/b/id/207485-M.jpg', 180, 302, DEFAULT), (43, 'OL25440979M', 'Discourses, Fragments, Handbook', NULL, '{"Epictetus"}', 390, 'https://covers.openlibrary.org/b/id/7275050-M.jpg', 180, 274, DEFAULT), (44, 'OL24211309M', 'JEM', 'The discovery of another habitable world might spell salvation to the three (Food Bloc, Fuel Bloc & People Bloc) bitterly competing power blocs of the war torn & resource-starved 21st century. But when their representatives arrive on Jem, with its three intelligent species, they discover instead the perfect situation into which to export their rivalries. Subtitled, with savage irony, ''The Making of a Utopia'', Jem is one of Frederik Pohl''s most powerful novels.', '{"Frederik Pohl"}', 314, 'https://covers.openlibrary.org/b/id/6522059-M.jpg', 180, 274, DEFAULT), (45, 'OL5725664M', 'Letters from a Stoic', NULL, '{"Seneca the Younger"}', 254, 'https://covers.openlibrary.org/b/id/103759-M.jpg', 180, 275, DEFAULT);
SELECT setval('"public"."books_id_seq"'::regclass, (SELECT MAX("id") FROM "public"."books"));
