INSERT INTO public.posts (id,reading_id,author_member_id,title,content,likes_count,is_spoiler,created_at,updated_at,editor_member_id) VALUES (1, 131, NULL, 'The Joy of Reading Aloud with Family', 'What''s everyone''s favorite way to organize their bookshelves? I''m in need of some inspiration!', DEFAULT, 't', DEFAULT, '2020-12-08T11:51:47.000Z', NULL), (2, 129, NULL, 'The Joy of Reading with Family', 'I''m looking for a new fantasy series to get into. Anyone have any recommendations? #fantasyseries #bookrecommendations', DEFAULT, 'f', DEFAULT, '2020-02-26T13:45:56.000Z', NULL), (3, 129, NULL, 'Why I Love Fantasy Adventure Novels', 'I''m looking for a new sci-fi novel to read. Any suggestions? #scifinovel #bookrecommendations', DEFAULT, 't', DEFAULT, '2020-11-11T22:25:20.000Z', NULL), (4, 132, NULL, 'I''m So Grateful for Book Club Friends!', 'I''m doing a giveaway for a booklight and a copy of ''The Silent Patient''! To enter, just comment below with your favorite thriller.', DEFAULT, 't', DEFAULT, '2020-11-07T10:49:08.000Z', NULL), (5, 129, NULL, 'Why I Love Paranormal Romance Novels', 'Who else loves reading books with strong male protagonists? #strongmen #bookrecommendations', DEFAULT, 'f', DEFAULT, '2020-02-10T01:12:14.000Z', NULL), (6, 128, NULL, 'The Power of Book Clubs in Action!', 'Has anyone else read ''The Poppy War''? What did you think of the world-building?', DEFAULT, 't', DEFAULT, '2020-01-13T12:15:08.000Z', NULL), (7, 129, NULL, 'I''m So Grateful for Book Club Friends!', 'I''m looking for a new romance novel to read. Any suggestions? #romancenovel #bookrecommendations', DEFAULT, 'f', DEFAULT, '2020-04-20T03:17:33.000Z', NULL), (8, 130, NULL, 'I''m So Grateful for Book Clubs Forever!', 'Has anyone else read ''The Golem and the Jinni''? What did you think of the magical realism?', DEFAULT, 'f', DEFAULT, '2020-06-26T18:02:17.000Z', NULL), (9, 126, NULL, 'My Favorite Bookish Accessories Ever', 'I''m looking for a new historical fiction novel to read. Any suggestions? #historicalfiction #bookrecommendations', DEFAULT, 'f', DEFAULT, '2020-10-26T21:39:22.000Z', NULL), (10, 129, NULL, 'The Best Books for Mental Health Awareness', 'Has anyone else read ''The City of Brass''? What did you think of the historical fantasy elements?', DEFAULT, 'f', DEFAULT, '2020-07-03T18:46:42.000Z', NULL), (11, 130, NULL, 'I Love Reading on Rainy Days', 'Who else loves reading books with complex, morally ambiguous characters? #morallyambiguous #characterstudy', DEFAULT, 't', DEFAULT, '2020-10-26T21:23:11.000Z', NULL), (12, 130, NULL, 'The Best Books for Self-Care Routines', 'I''m looking for a new sci-fi novel to read. Any suggestions? #scifinovel #bookrecommendations', DEFAULT, 'f', DEFAULT, '2020-09-17T20:29:22.000Z', NULL), (13, 126, NULL, 'The Best Books for Self-Love Sundays', 'What''s everyone''s favorite way to keep track of their reading challenge? I''m using a spreadsheet and it''s been a game-changer!', DEFAULT, 't', DEFAULT, '2020-03-11T02:55:04.000Z', NULL), (14, 131, NULL, 'My Favorite Book Club Memories This Week', 'Who else loves reading books with diverse characters and perspectives? #diversebooks #representationmatters', DEFAULT, 'f', DEFAULT, '2020-05-09T04:18:57.000Z', NULL), (15, 127, NULL, 'My Favorite Book Club Laughter Moments', 'I''m looking for a new romance novel to read. Any suggestions? #romancenovel #bookrecommendations', DEFAULT, 't', DEFAULT, '2020-02-18T13:59:26.000Z', NULL), (16, 125, NULL, 'The Best Books for Mindful Living', 'I just finished reading ''The Power'' and I''m still reeling from the experience. What''s your favorite thriller?', DEFAULT, 'f', DEFAULT, '2020-03-23T02:30:28.000Z', NULL), (17, 129, NULL, 'The Best Books for Self-Love Sundays', 'I just started a book journal and I''m loving it! Has anyone else tried journaling about their reads? #bookjournal #readinglog', DEFAULT, 'f', DEFAULT, '2020-11-11T22:12:09.000Z', NULL), (18, 129, NULL, 'My Favorite Book Club Laughter Moments', 'I just finished reading ''The Hunger Games'' and I''m still reeling from the experience. What''s your favorite dystopian novel?', DEFAULT, 't', DEFAULT, '2020-03-23T14:36:45.000Z', NULL), (19, 132, NULL, 'The Joy of Reading with Family', 'Has anyone else read ''The Song of Achilles''? What did you think of the historical fiction elements?', DEFAULT, 't', DEFAULT, '2020-12-08T11:51:20.000Z', NULL), (20, 126, NULL, 'Why I Love Fantasy Adventure Novels', 'I''m doing a read-along of ''Pride and Prejudice'' and I''d love for you to join me! #prideandprejudice #readalong', DEFAULT, 't', DEFAULT, '2020-12-08T12:00:10.000Z', NULL), (21, 125, NULL, 'My Favorite Book Club Experiences Ever', 'I''m looking for a new historical fiction novel to read. Any suggestions? #historicalfiction #bookrecommendations', DEFAULT, 't', DEFAULT, '2020-05-09T16:41:32.000Z', NULL), (22, 133, NULL, 'The Best Books for Self-Care Routines', 'I just finished reading ''The Hunger Games'' and I''m still reeling from the experience. What''s your favorite dystopian novel?', DEFAULT, 't', DEFAULT, '2020-05-21T16:55:50.000Z', NULL), (23, 129, NULL, 'The Best Books for Mental Health Awareness', 'I''m doing a giveaway for a signed copy of ''The Hate U Give''! To enter, just comment below with your favorite YA novel.', DEFAULT, 't', DEFAULT, '2020-03-19T14:10:14.000Z', NULL), (24, 126, NULL, 'My Favorite Book Club Inside Jokes', 'I''m looking for a new mystery novel to read. Any suggestions? #mysterynovel #bookrecommendations', DEFAULT, 'f', DEFAULT, '2020-11-19T22:35:14.000Z', NULL), (25, 131, NULL, 'I''m So Ready for the Next Book Hangover!', 'Who else loves reading books with complex, morally ambiguous characters? #morallyambiguous #characterstudy', DEFAULT, 'f', DEFAULT, '2020-12-16T11:52:58.000Z', NULL);
